import React from "react";
import Header from "./components/header";
import Landing from "./pages/landing";
import "./css/App.css";
import { Route, Routes } from "react-router-dom";

function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<Landing />} />
      </Routes>
    </div>
  );
}

export default App;
